CheckIntersect PROC USES ecx edx ebx esi oneX:DWORD, oneY:DWORD, oneBitmap:PTR EECS205BITMAP, twoX:DWORD, twoY:DWORD, twoBitmap:PTR EECS205BITMAP

	xor eax, eax
	;;check horizontal one's right border <=  two's left border, if yes, return 0, else jmp to check one's left border >= two's right border
	mov ecx, oneBitmap
	mov ebx, (EECS205BITMAP PTR [ecx]).dwWidth
	sar ebx, 1
	add ebx, oneX

	mov edx, twoBitmap
	mov esi, (EECS205BITMAP PTR [edx]).dwWidth
	sar esi, 1
	mov eax, twoX
	sub eax, esi

	cmp ebx, eax
	jle No_intersect

	;;check horizonal one's left border >=  two's right border, if yes return 0, else jmp to check vertical
        mov ebx, (EECS205BITMAP PTR [ecx]).dwWidth
        sar ebx, 1
        mov eax, oneX
	sub eax, ebx

        mov esi, (EECS205BITMAP PTR [edx]).dwWidth
        sar esi, 1
        add esi, twoX

        cmp eax, esi
        jge No_intersect

	;;check vertical, now we know they intersect horizontally, see if vertical as well, see if one's top <= two's bottom
        mov ebx, (EECS205BITMAP PTR [ecx]).dwHeight
        sar ebx, 1
        add ebx, oneY

        mov esi, (EECS205BITMAP PTR [edx]).dwHeight
        sar esi, 1
        mov eax, twoY
        sub eax, esi

	cmp ebx, eax
	jle No_intersect

	;;check vertical, see if one bottm >= two's top
	mov ebx, (EECS205BITMAP PTR [ecx]).dwHeight
        sar ebx, 1
        mov eax, oneY
        sub eax, ebx

        mov esi, (EECS205BITMAP PTR [edx]).dwHeight
        sar esi, 1
        add esi, twoY

        cmp eax, esi
        jge No_intersect

	;;they intersect
	mov eax, 1
	jmp DONE

No_intersect:
	mov eax, 0
DONE:
	ret
CheckIntersect ENDP

clearRotateBlit PROC USES ecx edx ebx esi edi  lpBmp:PTR EECS205BITMAP, xcenter:DWORD, ycenter:DWORD, angle:FXPT
	LOCAL xInput:DWORD, yInput:DWORD, transcol:BYTE,deltX:DWORD, deltY:DWORD, dstWidth:DWORD, dstHeight:DWORD, dstX:DWORD, dstY:DWORD, srcX:DWORD, srcY:DWORD, jj:DWORD
	
	
	mov jj, 0
	invoke FixedCos, angle
	mov ecx, eax			;ecx gets cos
	invoke FixedSin, angle	
	mov edi, eax			;edi gets sin
	
	mov esi, lpBmp
	mov bl, (EECS205BITMAP PTR [esi]).bTransparent
	mov transcol, bl		

	mov eax, (EECS205BITMAP PTR [esi]).dwWidth
	imul ecx
	mov deltX, eax
	sar deltX, 1			;half
	mov eax, (EECS205BITMAP PTR [esi]).dwHeight
	imul edi
	sar eax, 1			;half
	sub deltX, eax			
	
	
	mov eax, (EECS205BITMAP PTR [esi]).dwHeight
	imul ecx
	mov deltY, eax
	sar deltY, 1        ;half
	mov eax, (EECS205BITMAP PTR [esi]).dwWidth
	imul edi
	sar eax, 1          ;half
	add deltY, eax 
									
	mov eax, (EECS205BITMAP PTR [esi]).dwWidth
	add eax, (EECS205BITMAP PTR [esi]).dwHeight
	mov dstWidth, eax		
	mov dstHeight, eax
	
	neg eax          ;make negative
	mov dstX, eax		
	mov dstY, eax		
	
	sar deltY, 16		;get out of fixed p
	sar deltX, 16

	jmp checkX
yVals:	
	mov eax, dstX	
	imul ecx
	mov srcX, eax
	mov eax, dstY
	imul edi
	add srcX, eax		;X*cos + Y*sin
	
	mov eax, dstY
	imul ecx
	mov srcY, eax
	mov eax, dstX
	imul edi
	sub srcY, eax		;Y*cos - X*sin
	
	sar srcX, 16		;get out of fixed p
	sar srcY, 16
	
	cmp srcX, 0		
	jl incrY
	mov eax, (EECS205BITMAP PTR [esi]).dwWidth
	cmp srcX, eax		;srcX < dwWidth
	jge incrY
	
	cmp srcY, 0		
	jl incrY
	
	mov eax, (EECS205BITMAP PTR [esi]).dwHeight
	cmp srcY, eax		
	jge incrY

	;chekc for x bounds
	mov eax, xcenter
	add eax, dstX
	sub eax, deltX
	cmp eax, 0
	jl incrY		
	mov eax, xcenter
	add eax, dstX
	sub eax, deltX
	cmp eax, 639
	jge incrY		

	;check for y bounds
	mov eax, ycenter
	add eax, dstY
	sub eax, deltY
	cmp eax, 0
	jl incrY		
	mov eax, ycenter
	add eax, dstY
	sub eax, deltY
	cmp eax, 479
	jge incrY		

	mov eax, (EECS205BITMAP PTR [esi]).dwWidth	;grab color
	mov edx, srcY					
	imul edx
	add eax, srcX
	add eax, (EECS205BITMAP PTR [esi]).lpBytes
	mov dl, BYTE PTR [eax]
	cmp dl, transcol					;check for transparen
	je incrY
	
	mov ebx, xcenter				
	add ebx, dstX
	sub ebx, deltX
	mov xInput, ebx
	mov ebx, ycenter
	add ebx, dstY
	sub ebx, deltY
	mov yInput, ebx
	invoke DrawPixel, xInput, yInput, 0   ;;BYTE PTR [eax]  <-oldinput 
incrY:
	inc dstY

checkY:
	mov eax, dstY
	cmp eax, dstHeight
	jl yVals
	inc dstX

checkX:


        mov eax, dstHeight
	neg eax
        mov dstY, eax	
	mov eax, dstX
	cmp eax, dstWidth
	jl checkY

	ret 			; Don't delete this line!!!		
clearRotateBlit ENDP

